INSERT INTO `matrix_view` VALUES ('a5dc289dc20d44b5b07ce975a0c5615e', NULL, '{\"attributeList\":[{\"defaultExpression\":{\"expression\":\"like\",\"expressionEs\":\" %s contains %s \",\"expressionName\":\"包含\",\"isShowConditionValue\":1},\"expressionList\":[{\"expression\":\"equal\",\"expressionEs\":\" %s = %s \",\"expressionName\":\"等于\",\"isShowConditionValue\":1},{\"expression\":\"like\",\"expressionEs\":\" %s contains %s \",\"expressionName\":\"包含\",\"isShowConditionValue\":1}],\"isDeletable\":0,\"isRequired\":0,\"isSearchable\":1,\"matrixUuid\":\"a5dc289dc20d44b5b07ce975a0c5615e\",\"name\":\"用户id\",\"primaryKey\":0,\"sort\":0,\"startPage\":1,\"type\":\"input\",\"uuid\":\"user_id\"},{\"defaultExpression\":{\"expression\":\"like\",\"expressionEs\":\" %s contains %s \",\"expressionName\":\"包含\",\"isShowConditionValue\":1},\"expressionList\":[{\"expression\":\"equal\",\"expressionEs\":\" %s = %s \",\"expressionName\":\"等于\",\"isShowConditionValue\":1},{\"expression\":\"like\",\"expressionEs\":\" %s contains %s \",\"expressionName\":\"包含\",\"isShowConditionValue\":1}],\"isDeletable\":0,\"isRequired\":0,\"isSearchable\":1,\"matrixUuid\":\"a5dc289dc20d44b5b07ce975a0c5615e\",\"name\":\"用户名\",\"primaryKey\":0,\"sort\":1,\"startPage\":1,\"type\":\"input\",\"uuid\":\"user_name\"},{\"defaultExpression\":{\"expression\":\"like\",\"expressionEs\":\" %s contains %s \",\"expressionName\":\"包含\",\"isShowConditionValue\":1},\"expressionList\":[{\"expression\":\"equal\",\"expressionEs\":\" %s = %s \",\"expressionName\":\"等于\",\"isShowConditionValue\":1},{\"expression\":\"like\",\"expressionEs\":\" %s contains %s \",\"expressionName\":\"包含\",\"isShowConditionValue\":1}],\"isDeletable\":0,\"isRequired\":0,\"isSearchable\":1,\"matrixUuid\":\"a5dc289dc20d44b5b07ce975a0c5615e\",\"name\":\"分组\",\"primaryKey\":0,\"sort\":2,\"startPage\":1,\"type\":\"input\",\"uuid\":\"teamName\"},{\"defaultExpression\":{\"expression\":\"like\",\"expressionEs\":\" %s contains %s \",\"expressionName\":\"包含\",\"isShowConditionValue\":1},\"expressionList\":[{\"expression\":\"equal\",\"expressionEs\":\" %s = %s \",\"expressionName\":\"等于\",\"isShowConditionValue\":1},{\"expression\":\"like\",\"expressionEs\":\" %s contains %s \",\"expressionName\":\"包含\",\"isShowConditionValue\":1}],\"isDeletable\":0,\"isRequired\":0,\"isSearchable\":1,\"matrixUuid\":\"a5dc289dc20d44b5b07ce975a0c5615e\",\"name\":\"是否VIP\",\"primaryKey\":0,\"sort\":3,\"startPage\":1,\"type\":\"input\",\"uuid\":\"vipLevel\"},{\"defaultExpression\":{\"expression\":\"like\",\"expressionEs\":\" %s contains %s \",\"expressionName\":\"包含\",\"isShowConditionValue\":1},\"expressionList\":[{\"expression\":\"equal\",\"expressionEs\":\" %s = %s \",\"expressionName\":\"等于\",\"isShowConditionValue\":1},{\"expression\":\"like\",\"expressionEs\":\" %s contains %s \",\"expressionName\":\"包含\",\"isShowConditionValue\":1}],\"isDeletable\":0,\"isRequired\":0,\"isSearchable\":1,\"matrixUuid\":\"a5dc289dc20d44b5b07ce975a0c5615e\",\"name\":\"电话\",\"primaryKey\":0,\"sort\":4,\"startPage\":1,\"type\":\"input\",\"uuid\":\"phone\"},{\"defaultExpression\":{\"expression\":\"like\",\"expressionEs\":\" %s contains %s \",\"expressionName\":\"包含\",\"isShowConditionValue\":1},\"expressionList\":[{\"expression\":\"equal\",\"expressionEs\":\" %s = %s \",\"expressionName\":\"等于\",\"isShowConditionValue\":1},{\"expression\":\"like\",\"expressionEs\":\" %s contains %s \",\"expressionName\":\"包含\",\"isShowConditionValue\":1}],\"isDeletable\":0,\"isRequired\":0,\"isSearchable\":1,\"matrixUuid\":\"a5dc289dc20d44b5b07ce975a0c5615e\",\"name\":\"邮件\",\"primaryKey\":0,\"sort\":5,\"startPage\":1,\"type\":\"input\",\"uuid\":\"email\"}]}', 'user.xml', '<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<ci>\n  <attrs>\n    <attr name=\"user_id\" label=\"用户id\"/>\n    <attr name=\"user_name\" label=\"用户名\"/>\n    <attr name=\"teamName\" label=\"分组\"/>\n    <attr name=\"vipLevel\" label=\"是否VIP\"/>\n    <attr name=\"phone\" label=\"电话\"/>\n     <attr name=\"email\" label=\"邮件\"/>\n  </attrs>\n  <sql>\n  SELECT\n	`u`.`id` AS id, \n	 md5(`u`.`id`) AS uuid, \n    `u`.`user_name` AS name, \n    `u`.`user_id` as user_id,\n    `u`.`user_name` as user_name,\n	 u.email as email,\n	 u.phone as phone,\n	 if(u.vip_level=0,\'否\',\'是\') as vipLevel,\n    group_concat( `t`.`name`) AS teamName\n    FROM\n    `user` `u`\n    LEFT JOIN `user_team` `ut` ON `u`.`uuid` = `ut`.`user_uuid`\n    LEFT JOIN `team` `t` ON `t`.`uuid` = `ut`.`team_uuid`\n    GROUP BY u.uuid\n  </sql>\n</ci>\n\n');
