INSERT INTO `notify_policy` VALUES (851246982373377, '节点通知', 'neatlogic.module.process.notify.handler.OmnipotentNotifyPolicyHandler', 0, '{\"conditionOptionList\":[],\"paramList\":[],\"templateList\":[{\"action\":\"create\",\"actionName\":\"创建\",\"actionTime\":1679284635322,\"actionUser\":\"admin\",\"content\":\"标题：${DATA.title}<br>\",\"id\":851247712182272,\"name\":\"步骤激活\",\"notifyHandler\":\"EmailNotifyHandler\",\"startPage\":1,\"title\":\"节点通知测试-\"}],\"triggerList\":[{\"description\":\"流转到某个步骤，该步骤被自动激活时触发通知\",\"notifyList\":[{\"actionList\":[{\"notifyHandler\":\"EmailNotifyHandler\",\"notifyHandlerName\":\"邮件通知\",\"receiverList\":[\"processUserType#major\"],\"templateId\":851247712182272,\"templateName\":\"步骤激活\"}],\"conditionConfig\":{\"actionType\":\"创建\",\"conditionGroupList\":[],\"conditionGroupRelList\":[],\"fcu\":\"admin\",\"fcuVo\":{\"initType\":\"user\",\"isMaintenanceMode\":0,\"pinyin\":\"\",\"roleList\":[],\"roleUuidList\":[],\"startPage\":1,\"teamList\":[],\"teamNameList\":[],\"teamRoleList\":[],\"teamUuidList\":[],\"userAuthList\":[],\"uuid\":\"admin\"},\"lcu\":\"admin\",\"lcuVo\":{\"initType\":\"user\",\"isMaintenanceMode\":0,\"pinyin\":\"\",\"roleList\":[],\"roleUuidList\":[],\"startPage\":1,\"teamList\":[],\"teamNameList\":[],\"teamRoleList\":[],\"teamUuidList\":[],\"userAuthList\":[],\"uuid\":\"admin\"},\"searchMode\":\"value\",\"startPage\":1},\"id\":851247787679744}],\"trigger\":\"active\",\"triggerName\":\"步骤激活\"},{\"description\":\"步骤激活时分配处理人，处理人不存在或规则无法匹配到有效处理人时触发通知\",\"notifyList\":[],\"trigger\":\"assignexception\",\"triggerName\":\"分配异常\"},{\"description\":\"步骤自动开始或者处理人手动开始处理时触发通知\",\"notifyList\":[],\"trigger\":\"start\",\"triggerName\":\"步骤开始\"},{\"description\":\"有步骤转交权限的用户将当前步骤处理权限转交给其他用户时触发通知\",\"notifyList\":[],\"trigger\":\"transfer\",\"triggerName\":\"步骤转交\"},{\"description\":\"步骤完成时触发通知\",\"notifyList\":[],\"trigger\":\"succeed\",\"triggerName\":\"步骤成功\"},{\"description\":\"工单完成前，由处理人手动回退工单至前面的某个步骤时触发通知\",\"notifyList\":[],\"trig